    "2016-08-26T04:03:02.414648",nt"name": "harnessing-the-power-of-digital-data-for-science-and-society-report-of-the-interagency-wor",nt"isopen":
    true,nt"url": null,nt"notes": "This report provides a strategy to ensure
    that digital scientific data can be reliably preserved for maximum use in catalyzing
    progress in science and society.Empowered by an array of new digital technologies,
    science in the 21st century will be conducted in a fully digital world. In this
    world, the power of digital information to catalyze progress is limited only by
    the power of the human mind. Data are not consumed by the ideas and innovations
    they spark but are an endless fuel for creativity. A few bits, well found, can drive
    a giant leap of creativity. The power of a data set is amplified by ingenuity through
    applications unimagined by the authors and distant from the original field...",nt"license_title":
